import Foundation
import SwiftUI

//function used to dynamically configure width based on device dimensions
func width (w:CGFloat) -> CGFloat{
    //this const is to store the width of an iPhone14 (the device the UI is tested)
    let w14=UIScreen.main.bounds.size.width
    //this const is to store the width of the used device
    let wDevice=UIScreen.main.bounds.size.width
    //calculate the width based on the used device width
    return w*wDevice/w14
}

//function used to dynamically configure height based on device dimensions
func height (h:CGFloat) -> CGFloat{
    //this var is to store the height of an iPhone14 (the device the UI is tested)
    let h14=UIScreen.main.bounds.size.height
    //this const is to store the height of the used device
    let hDevice=UIScreen.main.bounds.size.height
    //calculate the width based on the used device height
    return h*hDevice/h14
}

//Color HEX Initialiser
extension Color {
    init(hex: String) {
        let hex = hex.trimmingCharacters(in: CharacterSet.alphanumerics.inverted)
        var int: UInt64 = 0
        Scanner(string: hex).scanHexInt64(&int)
        let a, r, g, b: UInt64
        switch hex.count {
            case 3: // RGB (12-bit)
                (a, r, g, b) = (255, (int >> 8) * 17, (int >> 4 & 0xF) * 17, (int & 0xF) * 17)
            case 6: // RGB (24-bit)
                (a, r, g, b) = (255, int >> 16, int >> 8 & 0xFF, int & 0xFF)
            case 8: // ARGB (32-bit)
                (a, r, g, b) = (int >> 24, int >> 16 & 0xFF, int >> 8 & 0xFF, int & 0xFF)
            default:
                (a, r, g, b) = (1, 1, 1, 0)
        }
        
        self.init(
            .sRGB,
            red: Double(r) / 255,
            green: Double(g) / 255,
            blue:  Double(b) / 255,
            opacity: Double(a) / 255
        )
    }
}

//Custom TextField Style
struct CustomTextField: TextFieldStyle {
    
    // Hidden function to conform to this protocol
    func _body(configuration: TextField<Self._Label>) -> some View {
        ZStack {
            //Rectangle
            ZStack {
                RoundedRectangle(cornerRadius: 20)
                    .fill(Color(#colorLiteral(red: 1, green: 1, blue: 1, alpha: 1)))
                RoundedRectangle(cornerRadius: 20)
                    .strokeBorder(Color(#colorLiteral(red: 0.843137264251709, green: 0.843137264251709, blue: 0.843137264251709, alpha: 1)), lineWidth: 2)
            }
            .compositingGroup()
            .shadow(color: Color(#colorLiteral(red: 0, green: 0, blue: 0, alpha: 0.12999999523162842)), radius:20, x:0, y:4)
            HStack {
                // Reference the TextField here
                configuration
            }
            .padding(.leading)
            .foregroundColor(.gray)
        }
    }
}

//Custom Button Style
struct CustomButton: ButtonStyle {
    func makeBody(configuration: Configuration) -> some View {
        ZStack{
            //Rectangle 2
            RoundedRectangle(cornerRadius: 30)
                .fill(Color(#colorLiteral(red: 0.2705882489681244, green: 0.3529411852359772, blue: 0.3921568691730499, alpha: 1)))
                //.frame(width: 314, height: 70)
                .shadow(color: Color(#colorLiteral(red: 0, green: 0, blue: 0, alpha: 0.5199999809265137)), radius:34, x:0, y:4)
            HStack{
                configuration.label
            }.padding()
        }
        
            
    }
}

